import React from 'react'

function MobileSignUp() {
    return (
        <div class="mobile-sign-in-up">
            <ul>
                <li><a class="sign-in" href="login.html">Sign In</a></li>
                <li><a class="sign-up" href="register.html">Sign Up</a></li>
            </ul>
        </div>
    )
}

export default MobileSignUp
